export function formatData(data) {


  const dataToFormat = data.split('\n');
  dataToFormat.splice(0, 1);
	console.log(dataToFormat);
	dataToFormat.slice(0, -2);

  dataToFormat.splice(0, 1, 'id,name,govsystem,x,y,race,prod,activity,tag,civlevel');
  const csvFile = dataToFormat.join('\n').replace(/ /g, ',');

  return csvFile;
}
